import PropTypes from 'prop-types'

const Card = ({children, reverse}) => {
    return (
        <div className="card">
            
        </div>
    );
}

Card.defaultProps = {
    reverse: false,
}

Card.propTypes = {
    children: PropTypes.node,
    reverse: PropTypes.bool
}
 
export default Card;
